(function() {
  var cheerio, request;

  request = require('request');

  cheerio = require('cheerio');

  request('http://yahoo.com', function(err, response, body) {
    var $, end, start;
    if (!err && response.statusCode === 200) {
      start = new Date();
      $ = cheerio.load(body);
      end = new Date();
      return console.log("ops took: " + (end.getTime() - start.getTime()) + " ms");
    }
  });

}).call(this);
